return(<div>
    <FaFilter/>Main Header
    <SearchBar search={search} setSearch={setSearch}/>
    {categoryFilter.length && categoryFilter.map((e:string) => <button>
        {e}
    </button>)
    }

    </div>)

}


export default MainHeader
